import { CategorieMaladie } from "./CategorieMaladie";
import { NiveauEducation } from "./NiveauEducation";
export class Patient {
  patientId: number;
  numeroDossier: string;
  nom: string;
  prenom: string;
  dateNaissance: string;
  sexe: string;
  residence?: string;
  addresse: string;
  numTelephone: string;
  cnam: boolean;
  niveauEducationId?: number;
  activieProfessionnelle?: boolean;
  consanguiniteParents?: boolean;
  specificationConsanguiniteParents?: string;
  hemoglobinopathieFamiliale?: boolean;
  nbrSiblings: number;
  nbrSiblingsAvecMaladie: number;
  notionConseilGenetiquePourParents?: boolean;
  maladieId: number;
  dateInclusion: string;
  inclusionPar: number;
  recycleBin: boolean;
  archive: boolean;
  raisonArchive?: string;
  hospitalisation: boolean;
  nbrHospitalisation: number;
  maladie: CategorieMaladie;
  niveauEducation?: NiveauEducation;
  Pere?:boolean;
  Mere?:boolean;
  Frere?:boolean;
  Soeur?:boolean;
  Autre?:boolean;
  
   
  
    constructor() {
      this.patientId = 0;
      this.numeroDossier = '';
      this.nom = '';
      this.prenom = '';
      this.dateNaissance = '';
      this.sexe = '';
      this.residence = undefined;
      this.addresse = '';
      this.numTelephone = '';
      this.cnam = false;
      this.niveauEducationId = undefined;
      this.activieProfessionnelle = undefined;
      this.consanguiniteParents = undefined;
      this.specificationConsanguiniteParents = undefined;
      this.hemoglobinopathieFamiliale = undefined;
      this.nbrSiblings = 0;
      this.nbrSiblingsAvecMaladie = 0;
      this.notionConseilGenetiquePourParents = undefined;
      this.maladieId = 0;
      this.dateInclusion = '';
      this.inclusionPar = 0;
      this.recycleBin = false;
      this.archive = false;
      this.raisonArchive = undefined;
      this.hospitalisation = false;
      this.nbrHospitalisation = 0;
      this.maladie = new CategorieMaladie();
      this.niveauEducation = new NiveauEducation();
    }
  }
